/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `stocktracker`.`stock_analyst_consensus_AFTER_INSERT` AFTER INSERT ON `stock_analyst_consensus` FOR EACH ROW
BEGIN
    UPDATE stock_note_source
       SET times_used = times_used + 1
	 WHERE id = NEW.notes_source_id;
END */;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
