INSERT INTO `stock_note` VALUES (48,1,'SRNE','<p>https://seekingalpha.com/article/4113371-sorrento-therapeutics-buy-sell-hold-big-rally</p>',8,5,'2011-10-30 17:00:00',1,0,0,NULL,NULL,2.53,6,'2017-11-11 23:21:08','2017-11-11 23:21:08'),(49,1,'TTOO','<p>https://finance.yahoo.com/news/t2-biosystems-announces-t2bacteria-ruo-142616938.html</p>',8,3,'2017-11-19 16:00:00',1,0,0,'0.00',NULL,4.02,10,'2017-11-21 22:26:50','2017-11-21 22:26:50'),(50,1,'EPZM','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">I have initiated a small watch item position in Epizyme.&nbsp;The company is now well-funded and has upcoming and definable catalysts.&nbsp;Epizyme is heavily leveraged to the success or failure of tazemetostat.&nbsp;The company does not intrigue me as much as a couple of other previous busted IPOs in the oncology space,&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Ignyta (</strong><a href=\"https://seekingalpha.com/symbol/RXDX\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(2, 73, 153);\"><strong>RXDX</strong></a><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">)</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;and&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Mirati Therapeutics (</strong><a href=\"https://seekingalpha.com/symbol/MRTX\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(2, 73, 153);\"><strong>MRTX</strong></a><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">)</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;which I&nbsp;</span><a href=\"https://seekingalpha.com/instablog/498952-bret-jensen/5066903-overlooked-niche-market\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(2, 73, 153);\">noted</a><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;recently.&nbsp;However, the stock does seem to have a favorable risk/reward profile at current levels so I have initiated a starter position.</span></p><p>https://seekingalpha.com/instablog/498952-bret-jensen/5074614-epizyme-upcoming-catalysts-horizon?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',15,3,'2017-11-20 16:00:00',1,0,0,'0.00',NULL,12.85,6,'2017-11-21 22:29:55','2017-11-21 22:29:55'),(51,1,'OTIC','<p>https://seekingalpha.com/research/48630172-busted-ipo-forum/5074715-deep-dive-otonomy#comments</p>',15,3,'2017-11-20 16:00:00',1,0,0,'0.00',NULL,5.36,7,'2017-11-21 22:26:40','2017-11-21 22:26:40'),(53,1,'NVAX','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Ultimately, the fate of NVAX in 2018 rests on the success of the maternal RSV vaccine trial. The Phase 3 trial will report interim results in H2 2018; after the failure of the older adult population, faith has been shaken in the vaccine as whole. Yet, the maternal trial\'s design looks like it will successfully eliminate some of the issues that dragged down the last trial. A successful data reading in 2018 will send NVAX shares rocketing, but another failure would severely damage the share price - and likely result in a painful dilution to keep the company going.</span></p>',17,3,'2017-11-22 09:51:38',1,0,0,'0',NULL,1.42,1,'2017-11-22 17:53:57',NULL),(54,1,'DVAX','<p>https://seekingalpha.com/article/4127235-dynavax-now-fun-begins?app=1&amp;auth_param=1ba2vi:1d1bmps:51ac4cc805ebf72329bc9fb14da2c02d&amp;uprof=45&amp;dr=1</p>',17,3,'2017-11-22 15:01:09',1,0,0,'0',NULL,18.55,1,'2017-11-22 23:01:27',NULL),(55,1,'VYGR','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Voyager is well-funded, has multiple \'shots on goal\' and a strategic partnership. The stock also has some analyst support. That being said, this intriguing concern is at least a few years away from successful commercialization. For aggressive investors, a small purchase might be warranted within a well-diversified biotech portfolio. This is what I have recently done as I do think this \"Busted IPO\" deserves to be on my \'watch list\' until it reaches later stage trial development.</span></p><p>https://seekingalpha.com/article/4099396-voyager-therapeutics-next-busted-ipo</p>',15,3,'2017-11-22 15:14:09',1,2,0,'0',NULL,14.18,1,'2017-11-22 23:15:13',NULL),(56,1,'ADMA','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5075939-hope-3-biotech-stock?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',8,3,'2017-11-24 15:53:00',1,0,0,'0',NULL,3.19,1,'2017-11-24 23:53:22',NULL),(57,1,'AUPH','<p>https://seekingalpha.com/article/4127547-3-reasons-buy-aurinia-pharmaceuticals?app=1&amp;auth_param=1ba2vi:1d1gr77:90c8ee3e35ca2feb3beccc17652629f5&amp;uprof=45&amp;dr=1</p>',17,3,'2017-11-24 16:06:30',1,0,0,'0',NULL,5.26,1,'2017-11-25 00:06:53',NULL),(58,1,'ADMS','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5075911-behind-adamas-big-month-long-rally?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',8,3,'2017-11-24 16:37:49',1,0,0,'0',NULL,33.68,1,'2017-11-25 00:38:08',NULL),(59,1,'RVNC','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">I am going to take a small position in RVNC and watch for further developments.&nbsp;It is not a stock we will place in the Insiders Forum at this particular time.&nbsp;The portfolio is already top heavy with holdings in this sector. The company will probably have to do one more capital raise and I worry somewhat about the rollout upon approval given it will have to go up against an established and deep pocketed competitor with a good brand name in their targeted space.&nbsp;That said, I do think RVNC\'s risk/reward profile is favorable and merits a small investment within a well-diversified biotech portfolio.</span></p><p>https://seekingalpha.com/research/498952-bret-jensen/5075307-deeper-look-revance-therapeutics#comments</p>',8,3,'2017-11-23 16:00:00',1,0,0,'0.00',NULL,26.50,2,'2017-11-25 01:25:22','2017-11-25 01:25:22'),(60,1,'NVAX','<p>https://seekingalpha.com/article/4127148-novavaxs-november-jump-start-something-bigger?app=1&amp;auth_param=1ba2vi:1d1bagc:81c92a0ad257cd58b07f0dd7b92d7530&amp;uprof=45&amp;dr=1#alt1</p>',17,3,'2017-11-24 17:32:48',1,0,0,'0',NULL,1.54,1,'2017-11-25 01:33:04',NULL),(61,1,'TACO','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5076230-del-taco-insiders-signaling-recent-indigestion?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',18,3,'2017-11-25 08:01:49',1,0,0,'0',NULL,12.07,1,'2017-11-25 16:02:50',NULL),(62,1,'UNIT','<p>15% Yield </p><p>https://seekingalpha.com/instablog/498952-bret-jensen/5075185-tims-corner-big-upside-15-percent-yield-play?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',19,3,'2017-11-25 08:14:55',1,2,0,'0',NULL,16.26,1,'2017-11-25 16:16:28',NULL),(63,1,'SGYP','<p>https://seekingalpha.com/article/4127672-synergy-pharmas-trulance-best-class-drug-really?app=1&amp;auth_param=1ba2vi:1d1lmp1:62f036aa554eb44bb0862120c9384b04&amp;uprof=45&amp;dr=1</p>',8,3,'2017-11-26 10:27:04',1,0,0,'0',NULL,1.90,1,'2017-11-26 22:12:47',NULL),(64,1,'REPH','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5076470-update-recro-pharma?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p><p><br></p><p>more detiled analysis</p><p>https://seekingalpha.com/article/4124888-recro-pharmaceuticals-prescriptions-pain-prescription-gain</p>',8,3,'2017-11-26 14:36:16',1,0,0,'0',NULL,9.38,1,'2017-11-26 22:38:18',NULL),(66,1,'OMER','<p>https://seekingalpha.com/article/4124394-biotech-forum-daily-digest-behind-omeros-blowout-results?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',8,3,'2017-11-26 14:46:43',1,0,0,'0',NULL,19.18,1,'2017-11-26 22:47:51',NULL),(67,1,'GNMX','<p>http://markets.businessinsider.com/stock/gnmx/company-profile</p>',9,3,'2017-11-27 08:17:21',1,0,0,'0',NULL,1.23,1,'2017-11-27 16:17:40',NULL),(68,1,'ARLZ','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">Paul, ARLZ, they got Zontivity from Merck for $25-million-- an approved heart drug. They\'ve focused on it, and promoted it. Done a good job; scripts rapidly growing. If you read their recent earnings report, and / or better yet, listen to the CC; you\'ll hear very positive forecasts for 2018 revenue growth. Not just Zontivity, but one or two other drugs they have.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">According to Goldman, CEO has been very successful at generating value, and then flipping cos. Seems that management has done a good job with turnaround thus far.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">Sizable debt lingers at high interest, but if revenue growth is in line with forward guidance, refinancing should not be difficult, and at much better rates.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">The only real downside that I see is that Zontivity sales waffle, but given trend, that seems unlikely. There is some possible competition from another drug on the horizon, but it appears to be a year away from being approved / commercial... and it\'s not clear that it is much better. With a multi-year head-start, Zontivity should be well positioned-- look at the Linzess vs. Trulance battle... clearly being first matters.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">Meanwhile the limited analyst coverage pegs the value at the mid-$4s, which would be a nice run.</span></p>',9,3,'2017-11-27 08:23:20',1,0,0,'0',NULL,1.63,1,'2017-11-27 16:23:32',NULL),(70,1,'TTOO','<p>https://finance.yahoo.com/news/t2-biosystems-announces-t2bacteria-ruo-142616938.html</p>',9,3,'2017-11-27 08:25:43',1,0,0,'0',NULL,4.29,1,'2017-11-27 16:25:54',NULL),(73,1,'EARS','<p><span style=\"background-color: rgb(255, 255, 255);