l if HTX-011 phase 3 readouts are positive. KeyPoints Inflammation is an unmet issue in local anesthetics. Local anesthetic failure has been observed when associated with inflammation. On page 2 and 3, we discuss two research publications to explain how inflammation can affect local anesthetics. Two theories are summarized by the authors providing evidence of reduced efficacy in generic bupivacaine when used by itself. Specifically, bupivacaine loses efficacy when used in an acidic environment produced by inflammation.</span></p>',9,3,'2017-12-07 16:00:00',1,1,0,'0.00',NULL,15.75,2,'2017-12-08 16:36:32','2017-12-08 16:36:32'),(92,1,'KMDA','<p>Sold 1000 of 1500 to by 250 shares of HRTX</p>',9,3,'2017-12-07 16:00:00',1,3,0,'0.00',NULL,4.47,2,'2017-12-08 16:36:25','2017-12-08 16:36:25'),(93,1,'AXON','<p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">AXON, have first quarter readouts on several compounds...........Intepirdine</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">Gait and Balance Impairments in Dementia</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">03/31/2018</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">Phase 2 data due 1Q 2018.</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">Nelotanserin</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">DLB patients experiencing REM Behavior Disorder (RBD)</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">01/31/2018</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">Phase 2b data due January 2018.</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">Intepirdine - HEADWAY-DLB</span></p><p><span style=\"background-color: rgba(0, 0, 0, 0.05);\">Dementia with Lewy bodies (DLB)</span></p>',9,3,'2017-12-13 12:21:08',1,0,0,'0',NULL,5.45,1,'2017-12-13 17:33:15',NULL),(94,1,'KPTI','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5085973-revisiting-karyopharm-therapeut