p>https://seekingalpha.com/article/4138010-2-small-biotechs-buy-now?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',8,3,'2018-01-17 09:06:58',1,0,0,'0',NULL,15.47,1,'2018-01-17 17:07:24',NULL),(131,1,'CLSN','<p><a href=\"https://finance.yahoo.com/news/celsion-corporation-provides-corporate-2018-130000167.html\" target=\"_blank\" style=\"background-color: rgba(0, 0, 0, 0.05); color: rgb(19, 103, 154);\">https://finance.yahoo.com/news/celsion-corporation-provides-corporate-2018-130000167.html</a></p>',9,3,'2018-01-18 08:34:38',1,0,0,'0',NULL,2.59,1,'2018-01-18 16:34:55',NULL),(132,1,'NVAX','<p>Podwad<span style=\"background-color: rgba(0, 0, 0, 0.05); color: rgb(68, 68, 68);\">&nbsp;</span><span style=\"color: rgb(160, 160, 160);\">Jan 18, 2018 6:48 AM</span></p><p><span style=\"color: rgb(160, 160, 160);\">&nbsp;</span></p><p><br></p><p>NVAX stk hit $1.75 just now. Motley Fool put out article 2 hours ago positive on NVAX. Like CLSN and RNN, NVAX is risky but the reward well above average if successful. Reports say the news on the flu vaccine they will release in Feb is positive, and with the flu raging as it is the news should help NVAX. Hopefully will continue to build in price into announcement. Motley Fool article on NVAX below</p><p><br></p><p>A bad flu season\'s good for one thing</p><p><br></p><p>Cory Renauer (Novavax, Inc.): Influenza gets all the attention, but respiratory syncytial virus (RSV) sends more infants to American emergency rooms than any other virus. That\'s because an effective vaccine to prevent the disease from spreading remains elusive, despite 50 years of effort.</p><p><br></p><p>Novavax, Inc. is a small-cap biotech that was much larger a couple years ago, after its lead vaccine candidate became the first to show a statistically significant level of protection from RSV infection among older adults in a midstage clinical trial. The bottom fell out of the stock when the successful midstage results couldn\'t be repeated in a much larger vaccination study with older adults.</p><p><br></p><p>After its stock cratered, Novavax rightfully noted that the failed study in older adults took place during one of the mildest RSV seasons on record. Flu and RSV are entirely different viruses, but they tend to spread in tandem. If seasonality was the culprit, and this year\'s exceptionally rough flu season coincides with a higher RSV attack rate, Novavax will probably announce success when it posts results from an ongoing maternal immunization study in a couple of years.</p><p><br></p><p>In a nutshell, investigators injected a bunch of expecting mothers with either a placebo or Novavax\'s experimental RSV vaccine. A statistically significant decrease in RSV infections among newborns exposed to the vaccine in the womb would probably lead to an approval, and eventually more than $1 billion in RSV vaccine sales. Biotech stocks generally trade at mid-single-digit multiples of their annual revenue, and at recent prices, Novavax\'s entire market cap was just $604 million.</p><p><br></p><p>Investors need to understand that another failure is possible, and would lead to heavy losses. If you\'re willing to accept the risk, the stock has Facebook-beating potential written all over it.</p>',9,3,'2018-01-18 08:36:38',1,0,0,'0',NULL,1.86,1,'2018-01-18 16:36:50',NULL),(133,1,'TCON','<p>Cbus Neil<span style=\"background-color: rgba(0, 0, 0, 0.05); color: rgb(68, 68, 68);\">&nbsp;</span><span style=\"color: rgb(160, 160, 160);\">Jan 19, 2018 7:07 AM</span></p><p><br></p><p>TCON - tanking on what seems like good data? Picked some up.</p><p><br></p><p><br></p><p>SAN DIEGO , Jan. 19, 2018 (GLOBE NEWSWIRE) -- TRACON Pharmaceuticals&nbsp;</p><p>(NASDAQ:TCON), a clinical stage biopharmaceutical company focused on the</p><p>development and commercialization of novel targeted therapeutics for cancer, wet</p><p>age-related macular degeneration and fibrotic diseases, today announced that</p><p>positive initial clinical data from its ongoing Phase 1b/2 study of TRC105 and</p><p>Nexavar (sorafenib) in patients with advanced hepatocellular carcinoma (HCC)</p><p>were presented in a poster presentation at the 2018 ASCO Gastrointestinal</p><p>Cancers Symposium in San Francisco, California .</p><p><br></p><p><br></p><p>Initial data from the ongoing open-label, non-randomized study were presented by Dr. Kanwal Raghav from the University of Texas MD Anderson Cancer Center :</p><p>Partial responses by RECIST 1.1 occurred in 2 of 8 (25%) evaluable patients and a reduction of 50% or greater in alpha fetoprotein (AFP) concentration occurred in 3 of 8 (38%) evaluable patients. Reduction in AFP, a tumor marker expressed in patients with HCC, in early treatment may help identify a favorable response to treatment and was observed in both cases of partial response.Hybrid dosing consisting of four weekly doses of TRC105 at 10 mg/kg followed by every other week dosing at 15 mg/kg thereafter was tolerable when given with the standard Nexavar dose of 400 mg twice daily.Adverse events typical of each drug did not increase in frequency or severity when the drugs were administered concurrently.The trial is ongoing, with the completion of the enrollment of approximately 33 patients expected by the end of 2018.</p><p><br></p><p>We continue to be encouraged with the safety and activity of TRC105 in</p><p>combination with Nexavar in patients with HCC, a tumor type with limited</p><p>treatment options, said Charles Theuer , M.D., Ph.D., President and CEO of</p><p>TRACON. Importantly, the initial data from the current trial are consistent</p><p>with the 33% partial response rate by RECIST 1.1 reported in the completed Phase</p><p>1/2 study published by the National Cancer Institute in 2017. We expect to</p><p>complete enrollment of the current multicenter study by the end of 2018, and</p><p>will discuss a potential registration-enabling study of the combination of</p><p>TRC105 and Nexavar in HCC with regulatory authorities shortly thereafter.</p><p><br></p><p>The poster is available on TRACONs website at:</p><p><a href=\"http://www.traconpharma.com/publications.php\" target=\"_blank\" style=\"color: rgb(19, 103, 154);\">www.traconpharma.com/publications.php</a></p>',9,3,'2018-01-19 09:28:40',1,0,0,'0',NULL,2.90,1,'2018-01-19 17:28:54',NULL),(134,1,'ARLZ','<p>https://seekingalpha.com/article/4124194-aralez-pharmaceuticals-update-q3-earnings-release?v=1516307276&amp;comments=show</p>',17,3,'2018-01-19 11:05:09',1,0,0,'0',NULL,2.04,1,'2018-01-19 19:05:23',NULL),(135,1,'ADMS','<p>https://seekingalpha.com/article/4137616-adamas-pharmaceuticals-continued-upside-2018-beyond?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',NULL,3,'2018-01-22 10:07:04',1,0,0,'0',NULL,39.80,1,'2018-01-22 18:07:14',NULL),(136,1,'DVAX','<p>https://seekingalpha.com/article/4137665-dynavax-makes-case-investors?app=1&amp;auth_param=1ba2vi:1d5rkjd:1a3791d4bad3efcb5a1d1a914cef066b&amp;uprof=45&amp;dr=1</p>',17,3,'2018-01-22 10:07:39',1,0,0,'0',NULL,16.82,1,'2018-01-22 18:07:51',NULL),(137,1,'EIGR','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5100693-now-eiger-biopharmaceuticals?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',9,3,'2018-01-22 10:10:24',1,0,0,'0',NULL,8.90,1,'2018-01-22 18:10:43',NULL),(138,1,'FEYE','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5103097-getting-board-fireeye-train?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',8,3,'2018-01-22 10:37:06',1,0,0,'0',NULL,14.72,1,'2018-01-22 18:37:23',NULL),(139,1,'NVAX','<p>https://seekingalpha.com/article/4140450-novavax-tear-tears-follow</p>',17,3,'2018-01-26 08:41:33',1,0,0,'0',NULL,2.10,1,'2018-01-26 16:42:05',NULL),(140,1,'PRTA','<p>https://seekingalpha.com/instablog/498952-bret-jensen/5104423-investment-play-prothena?source=email_rt_author_readmore&amp;app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>',8,3,'2018-01-29 08:46:33',1,0,0,'0',NULL,44.93,1,'2018-01-29 16:46:56',NULL),(141,1,'KMPH','<p>https://seekingalpha.com/research/4